import axios from 'axios';

const API_URL = 'http://localhost:5000/api';

// Admin login
export const adminLogin = async (username, password) => {
  const response = await axios.post(`${API_URL}/admin/login`, { username, password });
  return response.data;
};

// Vehicle entry
export const logVehicleEntry = async (imageFile) => {
  const formData = new FormData();
  formData.append('image', imageFile);

  const response = await axios.post(`${API_URL}/parking/entry`, formData);
  return response.data;
};

// Vehicle exit
export const logVehicleExit = async (licensePlate) => {
  const response = await axios.post(`${API_URL}/parking/exit`, { licensePlate });
  return response.data;
};

// Get parking logs
export const getParkingLogs = async () => {
  const response = await axios.get(`${API_URL}/parking/logs`);
  return response.data;
};
